import {api} from "@/helpers/axios"

export const resource = "wagon-park" 

const getWagons = () => {
    return api.get(`${resource}/wagons`, {params: {is_active:'True'}})
}

const getWagon = () => {
    return api.get(`${resource}/wagon-type`, {params: {is_active:'True'}})
}

export default {
    getWagons
}
